import { useRouter } from 'next/router'
import { useEffect } from 'react'
import { isEmpty } from 'lodash'

const Dashboard = () => {
	const router = useRouter()

	useEffect(() => {
    if (isEmpty(window.localStorage.getItem('isToken'))) {
      router.push('/login')
    }
	}, [])

	return (
		<>Dashboard</>
	)
}

export default Dashboard
